column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
Gabhaidh nmcli an dà chuid ri dàta rèiteachaidh JSON dìreach agus ainm faidhle sa bheil an rèiteachadh. Mas e ainm faidhle a th' ann, thèid am faidhle a leughadh agus an t-susbaint aige a chur dhan bhuadh seo.

Mar eisimpleir: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
                set team.config /etc/my-team.conf
